import React, { Component } from 'react'

class Demo extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             msg: 'Welcome Visitors'
        }
    }
    

    render() {
        return (
            <>
           <h1>{this.state.msg}</h1>
           <button>Subscribe</button>
           </>
        )
    }
}

export default Demo
